  false,\n\t\"url\": null,\n\t\"notes\": \"Data on the breeding biology of tufted
  puffins, black-legged kittiwakes, glaucous-winged gulls, and common murres nesting
  at Porpoise Rocks were collected during the summers of 1976, 1977 and 1978. Data
  were also collected on the breeding biology of arctic terns, Canada geese, black
  oystercatchers and semipalmated plovers nesting in Constantine Harbor and near Phipps
  Rocks. A summary of the 1976, 1977 and 1978 breeding population estimates and hatching
  success the seabird colonies in the Porpoise Rocks-Constantine Harbor area is presented
  in Table 1. The phenology of reproductive activities of the seabirds in the Porpoise
  Rocks-Constantine Harbor area in 1976 (Nysewander and Knudsson 1977), 1977 (Sangster
  et al. 1978) and 1978 is presented in Table 2.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
